import React, { Component } from 'react';
import AppBar from '@material-ui/core/AppBar';

export class Header extends Component {
  render() {
    return (
      <AppBar position="static">

        <h1>Tray.io Registration form</h1>
      </AppBar>
    )
  }
}

export default Header
